import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as e,e as t}from"./app-1bdccc93.js";const r={},d=t('<blockquote><p><strong>git 常用的六个命令</strong>：1、第一次初始化；2、初始化仓库；3、加到缓存区；4、提交至本地仓库；5、推送本地仓库信息至远程仓库；6、拉取远程仓库最新文件。其中，第一次初始化有两种方式，一种语句较多，另一种语句较少。</p></blockquote><h2 id="精简版操作-git" tabindex="-1"><a class="header-anchor" href="#精简版操作-git" aria-hidden="true">#</a> 精简版操作 git</h2><h3 id="初始化" tabindex="-1"><a class="header-anchor" href="#初始化" aria-hidden="true">#</a> 初始化</h3><ol><li>git init 【初始化 init】</li><li>git add . 【提交到缓存区】</li><li>git commit -m ‘代码描述’【提交到本地仓库】</li><li>git remote add origin <code>git 仓库地址，https开头的，码云粘贴</code> 【本地仓库与云端关联】</li><li>git pull origin master 【提交到云端仓库，如未成功，执行下面强制推送】</li><li>git push origin master # -f 【强推】</li></ol><h3 id="后续操作仓库" tabindex="-1"><a class="header-anchor" href="#后续操作仓库" aria-hidden="true">#</a> 后续操作仓库</h3><p>初始化成功后，后面操作仓库，常用 4 个命令</p><ol><li>git pull 从云端仓库拉取最新代码</li><li>git add . 提交缓冲区</li><li>git commit -m &quot;修改代码&quot; 提交本地仓库</li><li>git push 提交到云端仓库</li></ol><h2 id="_1、第一次初始化" tabindex="-1"><a class="header-anchor" href="#_1、第一次初始化" aria-hidden="true">#</a> 1、第一次初始化</h2><ul><li>git init 【初始化 init】<br> git add . 【提交到缓存区】<br> git commit -m ‘代码描述’【提交到本地仓库】<br> git remote add origin <code>git 仓库地址，https开头的，码云粘贴</code> 【本地仓库与云端关联】<br> git pull origin master 【提交到云端仓库，如未成功，执行下面强制推送】<br> git push origin master # -f 【强推】</li></ul><h2 id="_2、初始化仓库" tabindex="-1"><a class="header-anchor" href="#_2、初始化仓库" aria-hidden="true">#</a> 2、初始化仓库</h2><p>git init</p><h2 id="_3、加到缓存区" tabindex="-1"><a class="header-anchor" href="#_3、加到缓存区" aria-hidden="true">#</a> 3、加到缓存区</h2><ul><li>git add .：添加所有项目至缓存区</li><li>git add 目录名：添加指定目录到缓存区</li><li>git add 文件名：添加指定文件到缓存区</li></ul><h2 id="_4、提交至本地仓库" tabindex="-1"><a class="header-anchor" href="#_4、提交至本地仓库" aria-hidden="true">#</a> 4、提交至本地仓库</h2><p>git commit -m “注释信息”</p><h2 id="_5、推送本地仓库信息至远程仓库" tabindex="-1"><a class="header-anchor" href="#_5、推送本地仓库信息至远程仓库" aria-hidden="true">#</a> 5、推送本地仓库信息至远程仓库</h2><ul><li>git push origin master：将本地分支的更新内容，全部推送至远程仓库 master 分支</li><li>git push origin dev：将本地 dev 分支推送到远程，再由一个人统一加到 master 分支上</li></ul><h2 id="_6、拉取远程仓库最新文件" tabindex="-1"><a class="header-anchor" href="#_6、拉取远程仓库最新文件" aria-hidden="true">#</a> 6、拉取远程仓库最新文件</h2><ul><li>git pull：拉取远程仓库所有分支合并到本地</li><li>git pull origin master：拉取远程 master 分支，合并到当前本地 master 分支</li><li>git fetch：仅做拉取操作，不做合并，合并需要自己再找其他方法</li></ul><p>注意：一般都用 git pull</p><h3 id="拓展阅读" tabindex="-1"><a class="header-anchor" href="#拓展阅读" aria-hidden="true">#</a> 拓展阅读</h3><h2 id="git-命令个别专用名词译名" tabindex="-1"><a class="header-anchor" href="#git-命令个别专用名词译名" aria-hidden="true">#</a> Git 命令个别专用名词译名</h2><p>Workspace：工作区<br> Index / Stage：暂存区<br> Repository：仓库区（或本地仓库）<br> Remote：远程仓库</p>',23),l=[d];function h(n,o){return a(),e("div",null,l)}const g=i(r,[["render",h],["__file","dczr2vfhgu4n2cft.html.vue"]]);export{g as default};
